import React, { useState } from 'react';
import './PrescriptionForm.css';

const PrescriptionForm = () => {
  const [prescription, setPrescription] = useState({
    medicines: [
      {
        medicineName: '',
        dosage: '',
        quantity: '',
        frequency: '',
        instructions: ''
      }
    ],
    notes: ''
  });

  const handleMedicineChange = (index, field, value) => {
    const updatedMedicines = [...prescription.medicines];
    updatedMedicines[index] = {
      ...updatedMedicines[index],
      [field]: value
    };
    setPrescription({ ...prescription, medicines: updatedMedicines });
  };

  const addMedicine = () => {
    setPrescription({
      ...prescription,
      medicines: [
        ...prescription.medicines,
        {
          medicineName: '',
          dosage: '',
          quantity: '',
          frequency: '',
          instructions: ''
        }
      ]
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission
    console.log(prescription);
  };

  return (
    <div className="prescription-form-container">
      <h2>Prescription Form</h2>
      <p>Please enter prescription details below</p>

      <form onSubmit={handleSubmit}>
        {prescription.medicines.map((medicine, index) => (
          <div key={index} className="medicine-section">
            <h3>Medicine #{index + 1}</h3>
            
            <div className="form-group">
              <label>Medicine Name</label>
              <input
                type="text"
                value={medicine.medicineName}
                onChange={(e) => handleMedicineChange(index, 'medicineName', e.target.value)}
                required
              />
            </div>

            <div className="form-row">
              <div className="form-group">
                <label>Dosage</label>
                <input
                  type="text"
                  value={medicine.dosage}
                  onChange={(e) => handleMedicineChange(index, 'dosage', e.target.value)}
                  required
                />
              </div>

              <div className="form-group">
                <label>Quantity</label>
                <input
                  type="number"
                  value={medicine.quantity}
                  onChange={(e) => handleMedicineChange(index, 'quantity', e.target.value)}
                  required
                />
              </div>
            </div>

            <div className="form-row">
              <div className="form-group">
                <label>Frequency</label>
                <input
                  type="text"
                  value={medicine.frequency}
                  onChange={(e) => handleMedicineChange(index, 'frequency', e.target.value)}
                  required
                />
              </div>

              <div className="form-group">
                <label>Instructions</label>
                <input
                  type="text"
                  value={medicine.instructions}
                  onChange={(e) => handleMedicineChange(index, 'instructions', e.target.value)}
                  required
                />
              </div>
            </div>
          </div>
        ))}

        <button type="button" onClick={addMedicine} className="add-medicine-btn">
          Add Another Medicine
        </button>

        <div className="form-group">
          <label>Notes</label>
          <textarea
            value={prescription.notes}
            onChange={(e) => setPrescription({ ...prescription, notes: e.target.value })}
            required
          />
        </div>

        <button type="submit" className="submit-btn">Submit Prescription</button>
      </form>
    </div>
  );
};

export default PrescriptionForm;
